import React, { useEffect, useState } from "react";
import { useNavigate, useParams } from "react-router-dom";
import axios from "axios";
import {
  Container,
  Paper,
  Typography,
  Grid,
  Button,
  CircularProgress,
} from "@mui/material";
import ArrowBackIcon from "@mui/icons-material/ArrowBack";

const DetailPagePet = () => {
  const [petData, setPetData] = useState(null);
  const [loading, setLoading] = useState(true);
  const navigate = useNavigate();

  const params = useParams();
  const petId = params.idPet;

  useEffect(() => {
    getPetData();
  }, []);

  const getPetData = async () => {
    try {
      const resultPetData = await axios.get(
        `http://localhost:8110/api/pet/get/${petId}`
      );

      if (!resultPetData.data) {
        console.log("La mascota no existe");
        navigatePetList();
        return;
      }

      setPetData(resultPetData.data);
      setLoading(false);
    } catch (error) {
      console.error(error);
    }
  };

  const navigatePetList = () => {
    navigate("/pets");
  };

  return (
    <Container>
      <Paper elevation={3} style={{ padding: 20, marginTop: 20 }}>
        <Grid container spacing={3}>
          <Grid item xs={12}>
            <Button
              variant="outlined"
              color="primary"
              startIcon={<ArrowBackIcon />}
              onClick={navigatePetList}
            >
              Volver a la Lista
            </Button>
          </Grid>
          <Grid item xs={12}>
            <Typography variant="h4" gutterBottom>
              Detalles de la Mascota
            </Typography>
          </Grid>
          <Grid item xs={12} md={6}>
            {loading ? (
              <CircularProgress />
            ) : (
              <>
                <Typography variant="h5" gutterBottom>
                  {petData.name}
                </Typography>
                <Typography variant="body1" gutterBottom>
                  <strong>Tipo:</strong> {petData.type}
                </Typography>
                <Typography variant="body1" gutterBottom>
                  <strong>Descripción:</strong> {petData.description}
                </Typography>
              </>
            )}
          </Grid>
          <Grid item xs={12} md={6}>
            {loading ? null : (
              <>
                <Typography variant="body1" gutterBottom>
                  <strong>Skill 1:</strong> {petData.skill1 || "N/A"}
                </Typography>
                <Typography variant="body1" gutterBottom>
                  <strong>Skill 2:</strong> {petData.skill2 || "N/A"}
                </Typography>
                <Typography variant="body1" gutterBottom>
                  <strong>Skill 3:</strong> {petData.skill3 || "N/A"}
                </Typography>
              </>
            )}
          </Grid>
        </Grid>
      </Paper>
    </Container>
  );
};

export default DetailPagePet;
